const { doc, type, defaultValue } = require('../common/utils').descriptors;

module.exports = {
    [type]: 'object',
    [doc]: 'Other plugin settings',
    animejs: {
        [type]: 'boolean',
        [doc]: 'Enable page animations',
        [defaultValue]: true
    },
    gallery: {
