      var posts = category.posts.sort('-date');
      var data = pagination(category.path, posts, {
        perPage: perPage,
        layout: ['category', 'archive', 'index'],
        format: paginationDir + '/%d/',
        data: {
          category: category.name,
          parents: findParent(category)
        }
      });
      return result.concat(data);
