        const tags = [1, 2, 3, 4, 5, 6].map(i => 'h' + i).filter(h => $(h).length > 0).slice(0, 3);
        if (tags.length === 0) {
            return toc;
        }
        $(tags.join(',')).each(function () {
            const level = tags.indexOf(this.name);
            const id = $(this).attr('id');
            const text = $(this).text();

            for (let i = 0; i < levels.length; i++) {
